'use strict';

/**
 * @ngdoc function
 * @name cardkitApp.controller:MainCtrl
 * @description
 * # MainCtrl
 * Controller of the cardkitApp
 */
angular.module('cardkitApp')
  .controller('MainCtrl', function ($scope, saveSvgAsPng) {
    $scope.config = {
      themes: [
        {
          name: 'Theme 1',
          background: '#CAE3EC',
          headline: '#4F4842',
          quote: '#4F4842',
          headlineFont: 'Baskerville',
          logoSrc: 'data:image/png;base64,',
          logoSecondarySrc: 'data:image/png;base64,',
        },
        {
          name: 'Theme 2',
          background: '#4F4842',
          headline: '#CAE3EC',
          quote: '#CAE3EC',
          headlineFont: 'Times',
          logoSrc: 'data:image/png;base64,',
          logoSecondarySrc: 'data:image/png;base64,'
        },
      ],
      svg: {
    		canvas: {
    			height: 335,
    			width: 600,
    			fill: function() {
            return $scope.theme.background;
          },
    		},
    		elements: [
          {
            name: 'Image',
            type: 'image',
            width: 200,
            height: function() {
              return this.width;
            },
            src: '',
            opacity: 1,
            x: '50%',
            y: '50%',
            preserveAspectRatio: 'xMinYMin meet',
            draggable: true,
            editable: {
              src: true,
              width: true,
              opacity: true
            }
          },
          {
            name: 'Logo',
            type: 'image',
            width: 250,
            height: function() {
              return this.width;
            },
            src: function() {
              return $scope.theme.logoSrc;
            },
            opacity: 1,
            x: '300',
            y: '260',
            preserveAspectRatio: 'xMinYMin meet',
            editable: false
          },
          {
            name: 'Credit',
            type: 'text',
            text: 'Credit: Insert name here',
            fill: function() {
              return $scope.theme.quote;
            },
            fontSize: 12,
            fontFamily: function() {
              return $scope.theme.headlineFont;
            },
            textAnchor: 'right',
            x: 430,
            y: 250,
            draggable: true,
            editable: {
              text: true,
              fontSize: {
                'Small': 12,
                'Medium': 18,
                'Large': 22,
                'Extra Large': 36,
              }
            },
          },
          {
            type: 'group',
            name: 'Title',
            x: 30,
            y: 90,
            editable: true,
            draggable: true,
            elements: [
              {
                name: 'Logo',
                type: 'image',
                width: 30,
                height: function() {
                  return this.width;
                },
                src: function() {
                  return $scope.theme.logoSecondarySrc;
                },
                opacity: 1,
                x: 20,
                y: 37,
                preserveAspectRatio: 'xMinYMin meet',
                editable: false
              },
              {
                name: 'Headline',
                type: 'text',
                text: 'I\'m attached to the image on the left. \nEdit me and drag me around',
                fill: function() {
                  return $scope.theme.quote;
                },
                fontSize: '26',
                fontFamily: function() {
                  return $scope.theme.headlineFont;
                },
                textAnchor: 'left',
                x: 55,
                y: 55,
                editable: {
                  text: true,
                },
              },
            ],
          },
    		],
      }
  	};

    $scope.theme = null;

    $scope.$watch('theme', function() {
      $scope.$broadcast('changeTheme');
    });

    // Drop handler.
    $scope.onDrop = function (data, event, key) {
      var dataTransfer = getDataTransfer(event);
      readFile(dataTransfer.files[0], key);
    };

    // Read the supplied file (from DataTransfer API)
    function readFile(file, key) {
      var reader = new FileReader();

      reader.onload = function() { 
        $scope.config.svg.elements[key].src = reader.result;
        $scope.$apply();
      };

      reader.readAsDataURL(file);
    }

    // Get the data transfer
    function getDataTransfer(event) {
      event.stopPropagation();
      event.preventDefault();
      return event.dataTransfer || null;
    }

    $scope.removeImage = function(key) {
      $scope.config.elements[key].src = '';
    };


    $scope.downloadSvg = function() {
      saveSvgAsPng(document.getElementById('snap-svg'), 'image.png');
    };
  });
